components/common/navigation:
{{#if theme_settings.themevale_header-layout-1}}
<div class="container navUser">
    <ul class="navUser-left navUser-section"> 
        {{#if currency_selector.currencies.length '>' 1}}
            <li class="navUser-item">
                {{> components/common/currency-selector}}
            </li>
        {{/if}}
        <li class="navUser-item">
            <span class="navUser-text">{{theme_settings.themevale_header-top-content}}</span>
        </li>
    </ul>
    <ul class="navUser-right navUser-section">
        <li class="navUser-item">
            <a class="navUser-action" href="/contact-us/">{{lang 'common.need_help'}}</a>
        </li>
        <li class="navUser-item">
            <a class="navUser-action" href="/faqs/">{{lang 'common.faq'}}</a>
        </li>
        <li class="navUser-item">
            <a class="navUser-action" href="/blog/">{{lang 'common.blog'}}</a>
        </li>
        {{#if settings.gift_certificates_enabled}}
            <li class="navUser-item">
                <a class="navUser-action" href="{{urls.gift_certificate.purchase}}">{{lang 'common.gift_cert'}}</a>
            </li>
        {{/if}}
        <li class="navUser-item navUser-item--compare show">
            <a class="navUser-action" href="{{urls.compare}}" data-compare-nav>{{lang 'common.compare'}} (<span class="countPill">0</span>)</a>
        </li>
        <li class="navUser-item navUser-item--account">
            <i class="icon" aria-hidden="true"><svg><use xlink:href="#icon-user" /></svg></i>
            {{#if customer}}
                <a class="navUser-action" href="{{urls.account.index}}"><strong>{{customer.name}}.</strong></a>
                <a class="navUser-action" href="{{urls.auth.logout}}">{{lang 'common.logout'}}</a>
            {{else}}
                <a class="navUser-action" href="javascript:void(0)" data-login-form>{{lang 'common.login'}}</a>
                {{#if settings.account_creation_enabled}}
                <span class="navUser-or">{{lang 'common.or'}}</span>
                <a class="navUser-action" href="{{urls.auth.create_account}}">{{lang 'common.create_account'}}</a>
                {{/if}}
                {{#if page_type '!==' 'login'}}
                    {{> components/themevale/header/login-form}}
                {{/if}}
            {{/if}}
        </li>
    </ul>
</div>
{{/if}}

components/common/navigation-list-altern:
{{#if children}}
    <p class="navPages-action navPages-action-depth-max has-subMenu is-root">
        <a class="text" href="{{url}}">{{name}}</a>
        <span class="navPages-action-moreIcon" aria-hidden="true">
            <svg class="icon"><use xlink:href="#icon-chevron-down" /></svg>
        </span>
    </p>
    {{> components/common/navigation-dropdown}}
{{else}}
    <a class="navPages-action" href="{{url}}"><span class="text">{{name}}</span></a>
{{/if}}

components/common/social-links:
{{#if social_media}}
    <ul class="socialLinks socialLinks--alt">
        {{#each social_media}}
            <li class="socialLinks-item">
                {{#if display_name '===' 'google+'}}
                    <a class="icon icon--google" href="{{url}}" target="_blank" rel="noopener">
                        <svg><use xlink:href="#icon-google" /></svg>
                    </a>
                {{else}}
                    <a class="icon icon--{{display_name}}" href="{{url}}" target="_blank" rel="noopener">
                        <svg><use xlink:href="#icon-{{display_name}}" /></svg>
                    </a>
                {{/if}}
            </li>
        {{/each}}
    </ul>
{{/if}}

components/themevale/header/quick-search:
{{{ snippet "forms_search"}}}
<form class="form" action="{{urls.search}}">
    <fieldset class="form-fieldset">
        <div class="form-field">
            <div id="search_category">
                <select name="category" class="select_category">
                    <option value="" selected="">All</option>
                    {{#each categories}}
                        <option value="{{id}}">{{name}}</option>
                        {{#if children}}
                            {{#each children}}
                                <option value="{{id}}">&ndash;&ndash;&ndash; {{name}}</option>
                                {{#if children}}
                                    {{#each children}}
                                        <option value="{{id}}">&ndash;&ndash;&ndash;&ndash;&ndash;&ndash; {{name}}</option>
                                        {{#if children}}
                                            {{#each children}}
                                                {{#if children}}
                                                    <option value="{{id}}">&ndash;&ndash;&ndash;&ndash;&ndash;&ndash;&ndash;&ndash;&ndash; {{name}}</option>
                                                {{else}}
                                                    <option value="{{id}}">&ndash;&ndash;&ndash;&ndash;&ndash;&ndash;&ndash;&ndash;&ndash; {{name}}</option>
                                                {{/if}}
                                            {{/each}}
                                        {{/if}}
                                    {{/each}}
                                {{/if}}
                            {{/each}}
                        {{/if}}
                    {{/each}}
                </select> 
                <svg class="icon"><use xlink:href="#icon-chevron-down" /></svg>
            </div>
            <input class="form-input" data-search-quick name="search_query" id="search_query" data-error-message="{{lang 'search.error.empty_field'}}" placeholder="{{lang 'search.quick_search.input_quickSearch'}}" autocomplete="off">
            <button class="btn-search" type="submit"><svg class="icon"><use xlink:href="#icon-search"></use></svg><span>Search</span></button>
        </div>
    </fieldset>
</form>
<div class="quickSearchResults" data-bind="html: results"></div>
